import { StyleSheet } from 'react-native';

import vars from './vars';

const style = StyleSheet.create({
  centerAll:{
    flexGrow: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  header:{
    width: vars.height/3,
    height:vars.width * (124/926),

    paddingHorizontal: vars.width * (26/926),
    paddingTop: vars.width * (20/926),
    alignContent: 'center',
    alignItems: 'center',
    backgroundColor: vars.secondaryColor,
    flexWrap: 'wrap', 
    flexDirection:'row',   
    position:"absolute",
    zIndex: 3, // works on ios
    elevation: 3, // works on android
    right: 0
  },
  switchManual:{
    borderRadius: 50,
    backgroundColor: vars.secondaryColor,
    width: vars.height * (200/926),
    height:vars.width * (64/428),
    justifyContent: 'center',
    alignItems: 'center',
  },
  switchManualObj:{
    width: vars.height * (55/926),
    height:vars.width * (55/428),
    transform:[{ scaleX: 1.5 }, { scaleY: 3 }]
  },
  main:{
    height:vars.width - vars.width * (164/926),//164
  },
  map: {
    width: vars.height,
    height: vars.width,
    position:"absolute",
    top: 0
  },

  containerMain:{
    width: vars.height * (365/428),
    flexGrow: 1,
    justifyContent: 'center',
  },
  rotateScreenSplash:{
    width: vars.height,
    height: vars.width,
    position: "absolute",
    flexGrow: 1,
    justifyContent: 'center',
    alignItems: "center",
    backgroundColor:"'rgba(0, 0, 0, 0.5)'"
  },
  logo:{
    width: vars.width * (20/926),
    height: vars.width * (20/926),
  },
  circle: {
    width: 20,
    height: 20,
    borderRadius: 20/2,
    backgroundColor:"#FF0000",
    marginRight:vars.height * (11/428),
  },
  
})

export default style
